import { React, useState } from 'react'
import { Link } from 'react-router-dom';
import axios from 'axios';
const SignUp = () => {

    const [email, setEmail] = useState('');
    const [password, setPassword] = useState('');
    const [emailError, setEmailError] = useState('');
    const [passwordError, setPasswordError] = useState('');
    const [serverMessage, setServerMessage] = useState('');

    const handleLoginForm = async (e) => {
        e.preventDefault();
        setEmailError('');
        setPasswordError('');
        setServerMessage('');

        try {
            const response = await axios('http://localhost:5000/api/auth/login', {
                email, password
            });
            console.log(response.data);
            setServerMessage(response.data.message || "Login successful");
        } catch (error) {
            if (error.response) {
                const message = error.response.data.message;
                setServerMessage(message);

                if (message.includes("email")) setEmailError(message);
                if (message.includes("password")) setPasswordError(message);
            } else {
                setServerMessage("Server error");
            }
        }
    }

    return (
        <div className='login-form'>
            <button type="button" className="close" data-dismiss="modal" aria-label="Close">
                <span aria-hidden="true"><i className="icon-autodeal-close"></i></span>
            </button>
            <div>
                <h4>Login</h4>

                <form onSubmit={handleLoginForm}>
                    {/* Email */}
                    <div className='input-box'>
                        <label htmlFor="email" className='label'>Email:</label>
                        <div className='input-wrap'>
                            <input
                                type="text"
                                value={email}
                                placeholder='Your Email'
                                id='email'
                                required
                                className='input'
                                onChange={(e) => setEmail(e.target.value)}
                            />
                            <span className='absolute top-[50%] -translate-y-1/2 left-4'><i className="fa-regular fa-envelope"></i></span>
                        </div>
                        {emailError && <p className="mt-1 text-sm text-red-500">{emailError}</p>}
                    </div>

                    {/* Password */}
                    <div className='input-box'>
                        <label htmlFor="password" className='label'>Password:</label>
                        <div className='input-wrap password-input'>
                            <input
                                type="password"
                                value={password}
                                placeholder='Your Password'
                                id='password'
                                required
                                className='input'
                                onChange={(e) => setPassword(e.target.value)}
                            />
                            <span className='absolute left-4 top-[50%] -translate-y-1/2'><i className="fa-solid fa-lock"></i></span>
                            <button type="button" className='password-btn'>
                                <i className="fa-regular fa-eye"></i>
                            </button>
                        </div>
                        {passwordError && <p className="mt-1 text-sm text-red-500">{passwordError}</p>}
                    </div>

                    {/* forget password */}
                    <div className='mb-4 text-right'>
                        <Link to="" className='text-sm'>Forget password?</Link>
                    </div>

                    {/* Submit button */}
                    <button type='submit' className='btn'>Login</button>
                </form>
                <p className='mt-3 text-center'>Don't have an account? <Link className='text-[#ff7101]'>Register</Link> </p>
            </div>
        </div>
    )
}

export default SignUp
